import React, { useState, useEffect } from 'react'
import { TextField, Typography, Grid, Button } from '@material-ui/core'
import { Card, CardMedia, CardContent, CardActions, IconButton, Paper } from '@material-ui/core';
import DeleteIcon from '@material-ui/icons/Delete'
import Navbar from '../../COMPONENTS/Navbar/Navbar';
import { api } from '../../COMPONENTS/axiosSetup'
function MaamulBadeeco() {
    function importAll(r) {
        let images = {};
        r.keys().map((item, index) => { images[item.replace('./', '')] = r(item); });
        return images;
      }
      const [q, setQ] = useState(0)
      
      
      const images = importAll(require.context('../../IMAGES', false, /\.(png|jpe?g|svg)$/));
    const [products, setProducts] = useState([])
    async function getProducts(){
      const data =   await (await api.get('/get/maamul/badeeco')).data
      setProducts(data)
      console.log(data)
    }
    useEffect(()=>{
        getProducts()
    }, [])
  return (
    <>
    <Navbar />
    <div style={{margin:'20px'}}>
      <Grid container align='center' >
        {console.log(products)}
        {products.map(product=>{
            return (
        <Grid item xs={12} sm={12}>
            <Card style={{display:"flex", justifyContent:'space-around', alignItems:'center'}}>
            <img src={images[product.image]} alt="" style={{width:"100px", height:'100px'}} />
            <Typography variant='h4'>{product.magac}</Typography>
            <Typography variant='h4'>{product.price}</Typography>
            </Card>
        </Grid>
            )
        })}
      </Grid>
    </div>
    </>
  )
}

export default MaamulBadeeco
